  }
  componentDidMount() {
    axios.get('/screams')
    .then(res => {
      this.setState()
    })
  }
  render() {
    return (
      <Grid container spacing={16}>
        <Grid item sm={8} xs={12}>
          <p>Content...</p>
        </Grid>
        <Grid item sm={4} xs={12}>
          <p>Profile</p>
        </Grid>
      </Grid>
    )
  }
}

export default home
